"      Contraception: Overview of issues specific to adolescents",
"     </a>",
"     <br/>",
"     <a class=\"medical medical_review\" href=\"mobipreview.htm?10/31/10744?source=see_link\">",
"      Pregnancy in adolescents",
"     </a>",
"     <br/>",
"     <a class=\"medical medical_review\" href=\"mobipreview.htm?36/51/37689?source=see_link\">",
"      Sexually transmitted diseases: Overview of issues specific to adolescents",
"     </a>",
"     <br/>",
"     <br/>",
"     The following organizations also provide reliable health information.",
