"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Classification of hepatic cysts",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        Simple (solitary) cyst*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Polycystic disease*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Parasitic",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Hydatid (echinococcal)&bull;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Neoplastic",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Primary",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Cystadenoma&bull;, cystadenocarcinoma&Delta;, squamous cell carcinoma&Delta;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Secondary",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Carcinoma of ovary&Delta;, pancreas&Delta;, colon&Delta;, kidney&Delta;, neuroendocrine&Delta;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Duct related",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Caroli's disease&bull;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Bile duct duplication&bull;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        False cysts",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Traumatic intrahepatic hemorrhage&Delta;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Intrahepatic infarction&Delta;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Intrahepatic biloma&Delta;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Ciliated foregut cyst&Delta;",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Common",
"     <br>",
"      &bull; Uncommon",
"      <br>",
"       &Delta; Rare",
"      </br>",
"     </br>",
"    </div>",
