"     * These case series involved 136 outpatients in rural Scotland, 57 hospitalized patients in Rochester, NY, 42 inpatients and 8 outpatients at a referral center in Israel, 157 inpatients at a university hospital in Strassbourg, France, 100 hospitalized patients at a university hospital in Bangkok, 45 outpatients and 87 inpatients at a university hospital in Greece, 106 patients at a mixed rural-urban referral center in Spain, and 75 patients seen at the National Skin Center, Singapore.",
"     <br>",
"      &bull; Other infections included: a single case of dermatophytic fungal infection (Scotland); single cases of leprosy, pneumococcal pneumonia, influenza, fungal mycetoma, and gonorrhea (New York); single cases of infection with yersinia enterolytica, mycoplasma pneumonia, chlamydia pneumoniae and C. trachomatis (France); 21 cases of non-streoptococcal upper respiratory tract infections along with single cases of infection with brucella abortus and esherichia coli (Spain); 13 cases of acute infections with EBV or CMV and 2 cases of salmonellosis (Greece); 13 cases of viral pharyngitis and single cases of varicella, cat-scratch disease, and gonorrhea (Singapore).",
"      <br>",
"       &Delta; Four patients in this series were taking oral contraceptives, but the authors listed these cases as idiopathic on the basis of durations of administration ranging from 2 months to 8 years prior to the development of erythema nodosum.",
"       <br>",
"        &loz; Diagnoses listed under \"Other\" included: a single case of Hodgkin's disease (Scotland); two \"SLE variants\" and single cases of pancreatitis and glomerulonephritis (New York); one case of \"T-cell immunodeficiency\" (Israel); two cases of Sweet's syndrome and one patient with gastric cancer (Spain); one case of Sj&ouml;gren's syndrome (Greece).",
